import React, { useEffect, useState } from 'react';
import { Col, Row, ListGroup } from 'react-bootstrap';

const ListKategori = () => {

	const [keranjangs, setKeranjangs] = useState(
		[
		  {
		    "jumlah": 1,
		    "total_harga": 14000,
		    "product": {
		      "id": 2,
		      "nama": "Nasi Goreng Telur",
		      "gambar": "nasi-goreng-telor.jpg",
		      "harga": 14000,
		      "kategori": {
		        "id": 1,
		        "nama": "Makanan"
		      }
		    },
		    "id": 2
		  },
		  {
		    "jumlah": 1,
		    "total_harga": 12000,
		    "product": {
		      "id": 3,
		      "nama": "Nasi Rames",
		      "gambar": "nasi-rames.jpg",
		      "harga": 12000,
		      "kategori": {
		        "id": 1,
		        "nama": "Makanan"
		      }
		    },
		    "id": 3
		  },
		  {
		    "jumlah": 1,
		    "total_harga": 10000,
		    "product": {
		      "id": 6,
		      "nama": "Bakso",
		      "gambar": "bakso.jpg",
		      "harga": 10000,
		      "kategori": {
		        "id": 1,
		        "nama": "Makanan"
		      }
		    },
		    "id": 4
		  }
		]
	)

	useEffect(() => {
		axios
			.get(API_URL + "keranjangs")
			.then((response) => {
				console.log("cek")
				setKeranjangs(response.data);
			})
			.catch((error) => {
				// handle error
				console.log(error);
			});
	}, [])

	return(
		<Col md={3} mt="2">
			<h4><strong>Hasil</strong></h4>
			<hr />
			{keranjangs.length !== 0 && (
				<ListGroup variant="flush">
					{ keranjangs.map((menuKeranjang) => (
						<ListGroup.Item key={menuKeranjang.id}>
							{console.log(menuKeranjang)}
							<Row>
								<Col>
									<h5>menuKeranjang.</h5>
									<h5></h5>
									<h5></h5>
								</Col>
							</Row>
						</ListGroup.Item>
					))}
				</ListGroup>
			)}
		</Col>
	)
}

export default React.memo(ListKategori);
